Northlanders Book 4: The Plague Widow

Genre - Action/Adventure

English | CBR | 8 Issues

Written by Brian Wood
Art by Leandro Fernandez
Covers by Massimo Carnevale

Viking Russia A.D.1020, in a remote settlement rocked by a contagious outbreak. As the citizens focus on shutting out the outside world, they don't realize who they're shutting themselves in with.

